import { useState, useEffect} from "react";

const App = ()  => {
  const [ value, setValue] = useState(null)
  const [ message, setMessage ] = useState(null)
  const [ previousChats, setPreviousChats ] = useState([])
  const [ currentTitle, setCurrentTitle ] = useState(null)

  const createNewChat = () => {
    setMessage(null)
    setValue("")
    setCurrentTitle(null)
  }

  const handleClick = (uniqueTitle) => {
    setCurrentTitle(uniqueTitle)
    setMessage(null)
    setValue("")
  }

  const getMessages = async () => {
    const options = {
      method: "POST",
      body: JSON.stringify({
        message: value
      }),
      headers: {
        "Content-Type": "application/json"
      }
    }
    try {
      const response = await fetch('http://localhost:8000/completions', options)
      const data = await response.json()
      setMessage(data.choices[0].message)
    } catch(error){
      console.error(error)
    }
  }

  useEffect(() => {
    if(!currentTitle && value && message){
      setCurrentTitle((value))
    }
    if (currentTitle && value && message){
      setPreviousChats(previousChats => (
          [...previousChats,
            {
              title: currentTitle,
              role: "user",
              content: value
            },
            {
              title: currentTitle,
              role: message.role,
              content: message.content
            }]
      ))
    }
  }, [message, currentTitle, value]);

  const currentChat = previousChats.filter(previousChat => previousChat.title === currentTitle)
  const uniqueTitles = Array.from(new Set(previousChats.map(previousChat => previousChat.title)))

  return (
      <div className="app">
        <aside className="side-bar">
          <button onClick={createNewChat} aria-label="Start new chat">+ New Chat</button>
          <ul className="history" role="navigation" aria-label="Chat History">
            {uniqueTitles?.map((uniqueTitle, index) =>
                <li key={index} onClick={() =>handleClick(uniqueTitle)}>{uniqueTitle}</li>)}
          </ul>
          <nav>
            <p>Made by Kyle</p>
          </nav>
        </aside>
        <main className="main">
          {/* Added "role" and "aria-label" for screen readers */}
          {!currentTitle && <h1>KyleGPT</h1>}
          <ul className="feed" role="list" aria-label="Current Chat">
            {currentChat?.map((chatMessage, index) => <li key={index}>
              <span className="role">{chatMessage.role}</span>
              <span>{chatMessage.content}</span>
            </li>)}
          </ul>
          <div className="bottom-section">
            <div className="input-container">
              {/* Added hidden label for accessibility */}
              <label for="chatInput" className="sr-only">Type message here</label>
              <input id="chatInput" value={value} onChange={(e ) => setValue(e.target.value)}/>
              <button id="submit" onClick={getMessages} aria-label="Send Message">➢</button>
            </div>
            <p className="info">
              ChatGPT Oct 23 Version. Free Research Preview.
              Our goal is to make AI systems more natural and safe to interact with.
              Your feedback will help us improve.
            </p>
          </div>
        </main>
      </div>
  );
}

export default App;
